import React, {component} from 'react';

class Login extends component {
    constructor(props){
        super(props);
        this.state = {
          backgroundColor: "black",
          activeColor: "info",
        }
      }
    render() {
        return(
            <h1>Halo</h1>
        )
    }
}

export default Login;
